import { ALLCOUNTRIES } from "./accion";
const initialState = {
  countries: [],
};

const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    case ALLCOUNTRIES: {
      console.log(action.payload);
      return {
        ...state,
        countries: action.payload,
      };
    }
    default:
      return state;
  }
};
export default rootReducer;
